import * as t from "./types";

export function buttonReducer(count = 0,action) {
    
  switch (action.type) {
    case t.DID:{
        console.log(count+1)
        return count+1;
      }
      break;
    case t.CANCELED:{
        console.log("canceled");
        console.log(count-1)
        return count-1;
      }
      break;
    case t.CLOSED:{
        console.log("closed");
        console.log(count+10)
        return count+10;
      }
      break;
    default:
      return;
  }
}
